import React from 'react'

class Navigation extends React.Component
{
render()
{
    return(
        <div>
            <nav className="navbar">
                <ul>
                <li><a href ="">MENU</a> </li>
                <li><a >GENRE</a> </li>
                <li><a >DATE</a> </li>
                    </ul>
            </nav>
        </div>
    )
}
}
export default Navigation
